import Link from 'next/link';

const Navbar = () => (
<div>



<div className="sidenav">
  <a href="/">Home</a>
  <a href="/about">About</a>
  <a href="/contact">Contact</a>

</div>



        <style jsx>{`
        body {
            font-family: "Lato", sans-serif;
          }
    .sidenav{
                    height: 100%;
            width: 0;
            position: fixed;
            z-index: 1;
            top: 0;
            left: 0;
            background-color: #111;
            overflow-x: hidden;
            transition: 0.5s;
            padding-top: 60px;
    }
     .sidenav a:hover{
        color: #f1f1f1;

    }
    .sidenav a{
        padding: 8px 8px 8px 32px;
        text-decoration: none;
        font-size: 25px;
        color: #818181;
        display: block;
        transition: 0.3s;
      
    }
    .sidenav .closebtn {
        position: absolute;
        top: 0;
        right: 25px;
        font-size: 36px;
        margin-left: 50px;
      }
      
@media screen and (max-height: 450px) {
    .sidenav {padding-top: 15px;}
    .sidenav a {font-size: 18px;}
  }


`}</style>
</div>


);


export default Navbar;
